#include <bits/stdc++.h>

using namespace std;

int commonChild(string s1, string s2)
{
	if (!s1.size() || !s2.size())
	{
		return 0;
	}
	vector<vector<int>> M(s1.length() + 1, vector<int>(s2.length() + 1, 0));

	for (int i = 1; i <= s1.length(); i++)
	{
		for (int j = 1; j <= s2.length(); j++)
		{
			if (s1[i - 1] == s2[j - 1])
			{
				M[i][j] = M[i - 1][j - 1] + 1;
			}
			else
			{
				M[i][j] = max(M[i][j - 1], M[i - 1][j]);
			}
		}
	}

	return M[s1.length()][s2.length()];
}

int main()
{
	cout << commonChild("", "");
}